import React from 'react'

import image from './images/présentation.jpg'
import './Presentation.css';

const Presentation = () => {
  return(
      <div className='container'>
        <div className='secondContainer'>
          <img className='image' src={image}/>
        </div>
      </div>
  )
}

export default Presentation
